'''Harlequin Fish''', known simply as '''fish''' in-game, are a species of fish native to the [[Southern Sea|Southern]] and [[Eastern Sea]]s. They can be found in the [[Mogre Camp]] and the [[underwater]] area beneath [[Fossil Island]], but cannot be caught by [[fishing]].

